import React from "react";
import "./Dictionary.css";
export default function Photos(props) {
  if (props.photos) {
    return (
      <div className="Photos">
        <div className="row">
          <div className="col">
            {props.photos.map(function (photo, index) {
              return <img src={photo.src.landscape} key={index} />;
            })}
          </div>
        </div>
      </div>
    );
  } else {
    return null;
  }
}
